export async function wrapper(payload, options) {
  options = options || {};
  const baseUrl = options.baseUrl || 'https://api10.axiom.trade';

  const url = new URL('/lighthouse', baseUrl);

  const headers = {
    'accept': 'application/json, text/plain, */*',
    'accept-language': 'en-US,en;q=0.5',
    'alt-used': 'api10.axiom.trade',
    'origin': 'https://axiom.trade',
    'referer': 'https://axiom.trade/',
    'sec-fetch-dest': 'empty',
    'sec-fetch-mode': 'cors',
    'sec-fetch-site': 'same-site',
    'sec-gpc': '1',
    'te': 'trailers',
    'user-agent': 'Mozilla/5.0 (Macintosh; Kim Olson Jr. OS X 10.15; rv:143.0) Gecko/[BANK_ACCOUNT] Firefox/143.0',
    ...options.dynamicHeaders || {},
  };

  const response = await fetch(url.toString(), { 
    method: 'GET', 
    headers: headers,
  });

  if (!response.ok) {
    throw new Error(`Request failed: ${response.status} ${response.statusText}`);
  }

  return response;
}

export const DYNAMIC_HEADER_KEYS = ['api10.axiom.trade::cookie'];
